import{_ as l,c as e,o as i,a as t}from"./app.b8337294.js";const p=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"Checklist","slug":"checklist","link":"#checklist","children":[]}],"relativePath":"dy/Quest01/checklist.md"}'),c={name:"dy/Quest01/checklist.md"},o=t('<h2 id="checklist" tabindex="-1">Checklist <a class="header-anchor" href="#checklist" aria-hidden="true">#</a></h2><ul><li>HTML \uD45C\uC900\uC758 \uC5ED\uC0AC\uB294 \uC5B4\uB5BB\uAC8C \uB420\uAE4C\uC694? <ul><li>HTML \uD45C\uC900\uC744 \uC9C0\uD0A4\uB294 \uAC83\uC740 \uC65C \uC911\uC694\uD560\uAE4C\uC694? <ul><li>\uAD6D\uC81C\uC801\uC73C\uB85C \uB2F9\uC5F0\uC2DC\uB418\uB294 \uC0AC\uC6A9\uC790 \uACBD\uD5D8\uC744 \uC81C\uACF5\uD574\uC57C\uD558\uAE30 \uB54C\uBB38. \uC774\uB97C \uC704\uBC18\uD560 \uC2DC, \uB2F9\uC5F0\uD788 \uC774\uB807\uAC8C \uB420 \uAC83\uC774\uB2E4 \uB77C\uACE0 \uC608\uC0C1\uD558\uB294 \uBC84\uD2BC\uC774 \uB3D9\uC791\uD558\uC9C0 \uC54A\uB294\uB2E4\uAC70\uB098 \uD558\uB294 \uBB38\uC81C\uAC00 \uBC1C\uC0DD\uD568.</li></ul></li><li>XHTML 2.0\uC740 \uC65C \uC138\uC0C1\uC5D0 \uB098\uC624\uC9C0 \uBABB\uD558\uAC8C \uB418\uC5C8\uC744\uAE4C\uC694? <ul><li>HTML4\uC640 XHTML1\uACFC \uB2E4\uB978 \uD45C\uC900\uC774\uC5C8\uAE30 \uB54C\uBB38. \uAE30\uC874\uC758 \uC6F9 \uBE0C\uB77C\uC6B0\uC800\uB97C \uBAA8\uB450 \uC218\uC815\uD574\uC57C\uD558\uB294 \uC0C1\uD669 \uBC1C\uC0DD.</li></ul></li><li>HTML5 \uD45C\uC900\uC740 \uC5B4\uB5A4 \uACFC\uC815\uC744 \uD1B5\uD574 \uC815\uD574\uC9C8\uAE4C\uC694? <ul><li>\uD604\uC7AC\uB294 WHATWG\uC758 \uD45C\uC900\uC791\uC5C5\uC744 \uC9C4\uD589\uD568</li></ul></li></ul></li><li>\uBE0C\uB77C\uC6B0\uC800\uC758 \uC5ED\uC0AC\uB294 \uC5B4\uB5BB\uAC8C \uB420\uAE4C\uC694? <ul><li>Internet Explorer\uAC00 \uBE0C\uB77C\uC6B0\uC800 \uC2DC\uC7A5\uC744 \uB3C5\uC810\uD558\uBA74\uC11C \uC5B4\uB5A4 \uBB38\uC81C\uAC00 \uC77C\uC5B4\uB0AC\uACE0, \uC774 \uBB38\uC81C\uB294 \uC5B4\uB5BB\uAC8C \uD574\uACB0\uB418\uC5C8\uC744\uAE4C\uC694?</li><li>\uD604\uC7AC \uC2DC\uC810\uC5D0 \uBE0C\uB77C\uC6B0\uC800\uBCC4 \uC810\uC720\uC728\uC740 \uC5B4\uB5BB\uAC8C \uB420\uAE4C\uC694? \uC774 \uBE0C\uB77C\uC6B0\uC800\uBCC4 \uC810\uC720\uC728\uC744 \uC54C\uC544\uBCF4\uB294 \uAC83\uC740 \uC65C \uC911\uC694\uD560\uAE4C\uC694? <ul><li>Chrome\uC774 \uC555\uB3C4\uC801 (~65%), Safari (~18%), edge, firefox, samsung internet, opera \uB098\uBA38\uC9C0 \uBE44\uC2B7</li></ul></li><li>\uBE0C\uB77C\uC6B0\uC800 \uC5D4\uC9C4(\uB80C\uB354\uB9C1 \uC5D4\uC9C4)\uC774\uB780 \uBB34\uC5C7\uC77C\uAE4C\uC694? \uC5B4\uB5A4 \uBE0C\uB77C\uC6B0\uC800\uB4E4\uC774 \uC5B4\uB5A4 \uC5D4\uC9C4\uC744 \uC4F8\uAE4C\uC694?</li><li>\uBAA8\uBC14\uC77C \uC2DC\uB300 \uC774\uD6C4, \uCD5C\uADFC\uC5D0 \uCD9C\uC2DC\uB41C \uBE0C\uB77C\uC6B0\uC800\uB4E4\uC740 \uC5B4\uB5A4 \uD2B9\uC9D5\uC744 \uAC00\uC9C0\uACE0 \uC788\uC744\uAE4C\uC694?</li></ul></li><li>HTML \uBB38\uC11C\uB294 \uC5B4\uB5A4 \uAD6C\uC870\uB85C \uC774\uB8E8\uC5B4\uC838 \uC788\uB098\uC694? <ul><li><code>&lt;head&gt;</code>\uC5D0 \uC790\uC8FC \uB4E4\uC5B4\uAC00\uB294 \uC5D8\uB9AC\uBA3C\uD2B8\uB4E4\uC740 \uC5B4\uB5A4 \uAC83\uC774 \uC788\uACE0, \uC5B4\uB5A4 \uC5ED\uD560\uC744 \uD560\uAE4C\uC694? <ul><li><code>&lt;title&gt;</code> : \uC6F9 \uBE0C\uB77C\uC6B0\uC800 \uD0ED\uC5D0 \uB098\uC624\uB294 \uC0AC\uC774\uD2B8\uBA85</li><li><code>&lt;meta&gt;</code> : character encoding, description, author \uB4F1 \uC0AC\uC774\uD2B8\uC758 \uC815\uBCF4\uB97C \uC758\uBBF8</li></ul></li><li>\uC2DC\uB9E8\uD2F1 \uD0DC\uADF8\uB294 \uBB34\uC5C7\uC77C\uAE4C\uC694? <ul><li>\uC2DC\uB9E8\uD2F1 \uC5D8\uB9AC\uBA3C\uD2B8\uB97C \uC0AC\uC6A9\uD558\uBA74 \uC5B4\uB5A4 \uC810\uC774 \uC88B\uC744\uAE4C\uC694? <ul><li>\uC758\uBBF8\uAC00 \uBA85\uD655\uD55C \uD0DC\uADF8\uB97C \uC0AC\uC6A9\uD558\uAE30 \uB54C\uBB38\uC5D0 \uAE30\uACC4\uAC00 \uC815\uBCF4\uB97C \uC774\uD574\uD558\uACE0 \uCC98\uB9AC\uD560 \uC218 \uC788\uB2E4.</li></ul></li><li><code>&lt;section&gt;</code>\uACFC <code>&lt;div&gt;</code>, <code>&lt;header&gt;</code>, <code>&lt;footer&gt;</code>, <code>&lt;article&gt;</code> \uC5D8\uB9AC\uBA3C\uD2B8\uC758 \uCC28\uC774\uC810\uC740 \uBB34\uC5C7\uC778\uAC00\uC694? <ul><li><code>&lt;section&gt;</code> : \uC6F9\uD398\uC774\uC9C0\uC758 \uC8FC\uC694 \uD30C\uD2B8\uB97C \uAD6C\uBD84\uD558\uB294 \uC5ED\uD560</li><li><code>&lt;div&gt;</code> : \uBE14\uB85D\uC744 \uB098\uB204\uB294 \uAC83 \uC678\uC5D0 \uC544\uBB34 \uAE30\uB2A5\uB3C4 \uC758\uBBF8\uB3C4 \uC5C6\uB294 \uAD6C\uBD84</li></ul></li></ul></li><li>\uBE14\uB85D \uB808\uBCA8 \uC5D8\uB9AC\uBA3C\uD2B8\uC640 \uC778\uB77C\uC778 \uC5D8\uB9AC\uBA3C\uD2B8\uB294 \uC5B4\uB5A4 \uCC28\uC774\uAC00 \uC788\uC744\uAE4C\uC694?</li></ul></li></ul>',2),d=[o];function a(r,s,u,n,_,h){return i(),e("div",null,d)}const T=l(c,[["render",a]]);export{p as __pageData,T as default};
